import React from "react";
import { NavLink } from "react-router-dom";

const Search = () => {
  return (
    <div>
      <nav>
        <NavLink to="/" className="Nav_Logo">
          Door Step
        </NavLink>
        <input
          classNmae="srarchbar"
          placeholder="Search for items"
          autoFocus="autofocus"
        ></input>
      </nav>
      Search
    </div>
  );
};

export default Search;
